import React from 'react';
import {Container, Col, Image} from 'react-bootstrap';
import Photo from './img/professionalphoto.jpg'
import ResizeImage from 'react-resize-image'

const About=(props)=>{
    return(
        <>
            <h1>About Me</h1>
            <div className="photo">
            <ResizeImage
                src={Photo}
                alt="Profile picture of Summer Bakr"
                style={{ width: "300px", borderRadius:"20px"}}
            />
        </div>
        <div className='content'>
            <h3>I am a recent college graduate that became fascinated with software after working in a hospital and seeing firsthand the transformative power of technology. I wanted to become part of the movement of people pioneering change through technology, and set out on a mission to do just that by mastering coding languages. </h3>

            <h3> My Skills</h3>
                <button>Python</button>
        </div>
    </>
    );
}

export default About;
